I'm trying to use memory.enable_memory_arena_shrinkage in RunOptions to enable memory arena shrinkage post Run() in both 32-bit and 64-bit Windows. 
While 64-bit dll seems to work (since less memory is used), 32-bit onnxruntime dll throws an exception (ORT_CXX_API_THROW, ORT_INVALID_ARGUMENT(2), with no error message). 
I was expecting to benefit from this option in both platforms but am I missing something?
 
As a simplified example, I have attached the squeezenet example with the following modified lines:

```
  // Enable memory arena shrinkage
  Ort::RunOptions run_option;
  run_option.AddConfigEntry("memory.enable_memory_arena_shrinkage", "cpu:0");
  // score model & input tensor, get back output tensor
  auto output_tensors = session.Run(run_option, input_node_names.data(), &input_tensor, 1, output_node_names.data(), 1);
```
  
As previously mentioned, there is an exception in session.Run in 32-bit.

Note that if AddConfigEntry line is commented, there is no such throw either in 32-bit onnxruntime.dll. 

```
  // Enable memory arena shrinkage
  Ort::RunOptions run_option;
  // run_option.AddConfigEntry("memory.enable_memory_arena_shrinkage", "cpu:0");
  // score model & input tensor, get back output tensor
  auto output_tensors = session.Run(run_option, input_node_names.data(), &input_tensor, 1, output_node_names.data(), 1);
```

Is there something wrong when using run_option.AddConfigEntry("memory.enable_memory_arena_shrinkage", "cpu:0") compiled in 32 bits? 

**System information**
 - Onnxruntime 32-bit dll from: https://www.nuget.org/packages/Microsoft.ML.OnnxRuntime/
 - Tested version is the latest: 1.8.1
 - Environment: PC Win10 64 bit
 - Code of squeezenet modified and attached

**To Reproduce**
-  Compile attached squezenet.cpp into 32-bit exe and run with squeezenet.onnx in the same folder

[squeezenet_modified_code.zip](https://github.com/microsoft/onnxruntime/files/7163785/squeezenet_modified_code.zip)

