**Describe the bug**
When I try to follow the fns_candy_style_transfer tutorial using the C-API with CUDA I get a segmentation fault. CPU seems to work fine.

**System information**
- Linux Ubuntu 21.04
- ONNX Runtime installed from: [binary onnxruntime-linux-x64-gpu-1.8.1.tgz](https://github.com/microsoft/onnxruntime/releases/download/v1.8.1/onnxruntime-linux-x64-gpu-1.8.1.tgz)
- ONNX Runtime version: 1.8.1
- CUDA/cuDNN version: libcublasLt.so.11  libcublas.so.11  libcudart.so.11.0  libcudnn.so.8  libcufft.so.10  libcurand.so.10
- GPU model and memory: GeForce RTX 2060

**To Reproduce**
The following C code segfaults. The problematic operation is `SessionOptionsAppendExecutionProvider_CUDA`. It is an MWE of [the fns_candy_style_transfer tutorial](https://github.com/microsoft/onnxruntime-inference-examples/blob/main/c_cxx/fns_candy_style_transfer/fns_candy_style_transfer.c)
```c
#include "stdio.h"
#include "onnxruntime_c_api.h"
#include "cuda_provider_factory.h"

const OrtApi* g_ort = NULL;

#define ORT_ABORT_ON_ERROR(expr)                             \
  do {                                                       \
    OrtStatus* onnx_status = (expr);                         \
    if (onnx_status != NULL) {                               \
      const char* msg = g_ort->GetErrorMessage(onnx_status); \
      fprintf(stderr, "%s\n", msg);                          \
      g_ort->ReleaseStatus(onnx_status);                     \
      abort();                                               \
    }                                                        \
  } while (0);

int main(int argc, char const* argv[])
{
    const OrtApiBase* ptr_api_base = OrtGetApiBase();
    g_ort = ptr_api_base->GetApi(ORT_API_VERSION);
    OrtEnv* env;
    ORT_ABORT_ON_ERROR(g_ort->CreateEnv(ORT_LOGGING_LEVEL_WARNING, "test", &env));
    OrtSessionOptions* session_options;
    ORT_ABORT_ON_ERROR(g_ort->SessionOptionsAppendExecutionProvider_CUDA(session_options, 0));
    return 0;
}
```

**Expected behavior**
No segfault.

